  true,\n\t\"url\": null,\n\t\"notes\": \"The Equity in Athletics Disclosure Act Survey,
  2013 (EADA 2013), is part of the Equity in Athletics Disclosure Act Survey (EADA)
  program (http://www2.ed.gov/finaid/prof/resources/athletics/eada.html). Data is
  available since 2001 at <http://ope.ed.gov/athletics/>. The Equity in Athletics
  Disclosure Act requires co-educational institutions of postsecondary education that
  participate in a Title IV, federal student financial assistance program, and have
  an intercollegiate athletic program, to prepare an annual report to the Department
  of Education on athletic participation, staffing, and revenues and expenses, by
  men's and women's teams. This cross-sectional data collection was administered via
  an online survey. In 2013, the collection's response rate was 100 percent. Key statistics
  from EADA 2013 were designed to make prospective students aware of a schoolsufffd
  commitment to providing equitable athletic opportunities for its men and women students;
  as well, results were used in the Department's report to Congress on gender equity
  in intercollegiate athletics.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
